  ?prop a s223:NonWritableProperty .
  ?prop rdfs:label ?propLabel .

  # Retrieve ALC and MPC endpoint references, if present
  OPTIONAL { ?zone s223:hasALCEndpoint ?alcEndpoint . }
  OPTIONAL { ?zone s223:hasMPCEndpoint ?mpcEndpoint . }
